import React from 'react';

const Card = () => {
    return(
        <div>
            <img alt='orochi' src='https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/e3085d5b-afc4-43e3-b77a-9a919ea06c74/dbtitf3-ccefcbd0-a301-4db8-ade3-22bf96b2d45d.jpg/v1/fill/w_1024,h_1919,q_75,strp/orochi_fanart_by_anbox_dbtitf3-fullview.jpg?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..LzWmv2Wkpm2u6lLIMMNTf1ggJJJMwoBeMh5ruOmI4mg?200x200' />
            <div>
                <h2>Tono Oon</h2>
                <p>tono.oon@gmail.com</p>
            </div>
        </div>
    );
}

export default Card;
